    <script>
        let selectedParts = [];
        
        // Initialize diagram functionality
        $(document).ready(function() {
            console.log('Car diagram initialized');
            
            // Add click handlers for car parts
            $('a[onmousemove]').on('click', function(e) {
                e.preventDefault();
                const partId = $(this).find('g').attr('id');
                if (partId) {
                    // Toggle selection
                    const isSelected = $(this).hasClass('selected-part');
                    $(this).toggleClass('selected-part');
                    
                    // Update selected parts array
                    if (isSelected) {
                        selectedParts = selectedParts.filter(id => id !== partId);
                    } else {
                        selectedParts.push(partId);
                    }
                    
                    // Send selection to parent window
                    if (window.parent && window.parent !== window) {
                        window.parent.postMessage({
                            type: 'partSelection',
                            partId: partId,
                            selected: !isSelected,
                            allSelectedParts: selectedParts
                        }, '*');
                    }
                    
                    console.log('Selected parts:', selectedParts);
                }
            });
        });
    </script>
